import './App.css';
import React, { useState } from 'react';
import Child from './element'



function App() {
  const [names, setNames] = useState(['Greg', 'Sarah', 'Bobby', 'Kaitlyn', 'Tom']);

  const addName = (name) => {
    setNames(prev => [...prev,name])
  }

  return (
    <div>
      <div style={{padding:'20px'}}>

        <h1>header</h1>
        <button
        onClick={() => addName('Tom')}>
          Press to add Tom
        </button>

      </div>
      {names.map( name => {
        return <Child name={name} key={name}/>
        })
      }
    </div>
  );
}

export default App;
